import React from "react";
import styles from './header.module.css';

export const  Header = () => {
    return(
        <div className={styles.header}>
            <div className={styles.menu}>
                <img src="./images/1354860_20201112142649_570_0001.jpg"></img>
                <button className={styles.scan}>물건 인식</button>
                <button className={styles.carbon}>현재 탄소량</button>
                <button className={styles.guide}>가이드</button>
                <button className={styles.My}>My</button>
            </div>
        </div>
    );
}
